import React, {useState, useEffect, } from 'react'
import axios from "axios"
import {preventDefault} from "react"
import {Navigate} from "react-router-dom"
import { Link } from 'react-router-dom'


export default function Table({url}) {

    const [isUrl,setisUrl] = useState((false))
   
    const shorturlHandler= async (e)=>{
        e.preventDefault();
        try{
            
            console.log("clickedd")
            console.log(url)
            const shortUrl = await axios.get("/shorturls/get/"+url.short)
            if(shortUrl)
            setisUrl(true)        
        }
        catch(err){
            console.log(err)
        }
    }
    console.log(isUrl)

    
       isUrl && Navigate(url.full)
    

        return (
            <tr scope="row"> 
                
                <td >
                <a href={url.full}>{url.full}</a>
                </td>
                <td onClick={shorturlHandler}><Link  >{url.short}</Link></td>
                <td>{url.clicks}</td>
            
            </tr>
  )
}
